import React from "react";
import Header from "./header";
import image from '../resources/fallback.svg';

export default class Fallback extends React.Component{
    render(){
        return(
            <>
                <Header/>
                <div id="fallback">
                    <img src={image} alt="" />
                </div>
            </>
        )
    }
}
